css:
.git-plus .error {
  color: #d5880b;
}
.git-plus .success {
  color: #2db448;
}
.git-plus .atom-panel.modal.from-bottom {
  width: 600px;
}
.git-plus.info-view {
  overflow: auto;
  max-height: 30vh;
}
atom-text-editor .meta.diff.range.unified,
atom-text-editor::shadow .meta.diff.range.unified {
  color: #1492ff;
}
atom-text-editor .meta.diff.header,
atom-text-editor::shadow .meta.diff.header {
  color: #1492ff;
}
atom-text-editor .markup.deleted.diff,
atom-text-editor::shadow .markup.deleted.diff {
  color: #f42a2a;
}
atom-text-editor .markup.inserted.diff,
atom-text-editor::shadow .markup.inserted.diff {
  color: #2db448;
}
.git-plus-log {
  background-color: #f4f2ec;
  overflow-y: auto;
}
.git-plus-log #git-plus-commits {
  color: #463f2b;
  cursor: pointer;
}
.git-plus-log #git-plus-commits td {
  padding: 8px 10px;
  border-bottom: 1px solid #000;
  vertical-align: top;
}
.git-plus-log #git-plus-commits .author {
  width: 30%;
}
.git-plus-log #git-plus-commits .date {
  width: 25%;
}
.git-plus-log #git-plus-commits .message {
  width: 50%;
}
.git-plus-log #git-plus-commits .hashShort {
  width: 10%;
  text-align: right;
}
